import React, { useState, useEffect, useRef } from 'react';
import socketio from 'socket.io-client';

function WebcamDetector({ onDetection }) {
  const [isDetecting, setIsDetecting] = useState(false);
  const [fps, setFps] = useState(10);
  const videoRef = useRef(null);
  const socketRef = useRef(null);
  const frameQueue = useRef([]);
  const lastFrameTime = useRef(0);
  const animationFrameId = useRef(null);
  const frameRate = useRef(0);
  const lastFpsUpdate = useRef(0);
  const frameCount = useRef(0);

  // Procesamiento optimizado de frames
  const processFrameQueue = () => {
    const now = performance.now();
    const minFrameInterval = 1000 / fps;
    
    // Actualizar contador de FPS
    if (now - lastFpsUpdate.current >= 1000) {
      frameRate.current = frameCount.current;
      frameCount.current = 0;
      lastFpsUpdate.current = now;
    }
    
    if (frameQueue.current.length > 0 && now - lastFrameTime.current >= minFrameInterval) {
      const frameData = frameQueue.current.shift();
      frameCount.current++;
      
      if (videoRef.current) {
        try {
          // Usar URL.createObjectURL para mejor rendimiento con frames grandes
          const blob = new Blob([Uint8Array.from(atob(frameData.frame), c => c.charCodeAt(0))], { type: 'image/jpeg' });
          const url = URL.createObjectURL(blob);
          videoRef.current.src = url;
          // Liberar memoria después de cargar
          videoRef.current.onload = () => URL.revokeObjectURL(url);
        } catch (error) {
          console.error('Error processing frame:', error);
        }
      }
      
      if (onDetection) {
        onDetection({
          type: 'video',
          frame: `data:image/jpeg;base64,${frameData.frame}`,
          results: frameData.results,
          timestamp: frameData.timestamp
        });
      }
      lastFrameTime.current = now;
    }
    
    animationFrameId.current = requestAnimationFrame(processFrameQueue);
  };

  useEffect(() => {
    animationFrameId.current = requestAnimationFrame(processFrameQueue);
    return () => cancelAnimationFrame(animationFrameId.current);
  }, [fps]);

  useEffect(() => {
    // Configuración mejorada de Socket.IO
    socketRef.current = socketio('http://localhost:5000', {
      transports: ['websocket'],
      upgrade: false,
      reconnection: true,
      reconnectionAttempts: 5,
      reconnectionDelay: 1000,
      timeout: 20000
    });
    
    // Manejo de errores mejorado
    socketRef.current.on('connect_error', (err) => {
      console.error('Connection error:', err);
      setIsDetecting(false);
    });
    
    socketRef.current.on('connect_timeout', () => {
      console.error('Connection timeout');
      setIsDetecting(false);
    });
    
    socketRef.current.on('video_frame', (data) => {
      // Limitar cola pero priorizar frames más recientes
      if (frameQueue.current.length >= 3) {
        frameQueue.current.shift(); // Eliminar el frame más antiguo
      }
      frameQueue.current.push(data);
    });

    return () => {
      if (socketRef.current) {
        socketRef.current.disconnect();
      }
    };
  }, []);

  const toggleDetection = () => {
    if (!socketRef.current.connected) {
      alert('No hay conexión con el servidor. Intenta recargar la página.');
      return;
    }
    
    if (isDetecting) {
      socketRef.current.emit('stop_video');
      frameQueue.current = [];
    } else {
      frameQueue.current = [];
      socketRef.current.emit('start_video', { fps });
    }
    setIsDetecting(!isDetecting);
  };

  return (
    <div className="webcam-detector">
      <h2>Real-time Object Detection</h2>
      
      <div className="video-container">
        <img 
          ref={videoRef}
          alt="Live camera feed"
          style={{ 
            maxWidth: '100%',
            border: '2px solid #333',
            borderRadius: '4px',
            backgroundColor: '#000'
          }}
        />
        {isDetecting && (
          <div className="fps-indicator">
            FPS actual: {frameRate.current} | FPS objetivo: {fps}
          </div>
        )}
      </div>
      
      <div className="controls">
        <button 
          onClick={toggleDetection} 
          className={`detection-button ${isDetecting ? 'active' : ''}`}
        >
          {isDetecting ? (
            <>
              <span className="pulse-icon">●</span> Stop Detection
            </>
          ) : (
            'Start Detection'
          )}
        </button>
        
        <div className="fps-control">
          <label>Detection FPS: </label>
          <input 
            type="range" 
            min="1" 
            max="15" 
            value={fps} 
            onChange={(e) => setFps(parseInt(e.target.value))}
            disabled={isDetecting}
          />
          <span className="fps-value">{fps}</span>
        </div>
      </div>
    </div>
  );
}

export default WebcamDetector;
